  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data (327 records)
  were compiled by Mr. Bernard Coakley. This data base was received in June 1985.
  Principal gravity parameters include latitude, longitude, and observed gravity.
  The observed gravity values are referenced to the International Gravity Standardization
  Net 1971 (IGSN 71). The gravity anomaly computation uses the Geodetic Reference
  System 1967 (GRS 67) theoretical gravity formula. The data are randomly distributed
  within the Ashland area of northern Wisconsin.\",\n\t\"license_title\": null,\n\t\"extras\":
